import React, {
  Component
} from 'react';
import './TutorServiceRegister.css';
import 'bootstrap/dist/css/bootstrap.css';
import Datetime from 'react-datetime';
// var moment = require('moment');

export default class TutorServiceRegister extends Component {

state = {
  subjectList : [],
  topicList : [],
  value : 'Select Category'
}

filterSubjectList = (event) =>{
  console.log(event.target.value);
  console.log("djdhd");
  console.log(this.props.tutorRegisterDetails);
}


  render() {
  //  console.log(this.props.tutorRegisterDetails);
  const registerDetails = this.props.tutorRegisterDetails;
    return (
      <div>
      <table className="table table-striped table-borderless table-hover table-card">
        <thead>
          <tr className="header">
            <th>Category</th>
            <th>Subject</th>
            <th>Topic</th>
            <th>Service Type</th>
            <th>Class Size</th>
            <th>From Time</th>
            <th>To Time</th>
          </tr>
        </thead>
        <tbody>
        {this.props.tutorRegisterDetails.map((value,index) => {
          return (
            <tr>
            <td>
            <select onChange = {this.filterSubjectList.bind(this)}>
            {registerDetails.map((value) =>{
              return(
              <option key ={value.topicId}>{value.categoryType}</option>
            )})}
            </select>
            </td>
              <td><select>
              <option value = {value.subjectId}>
              {value.subjectName}
              </option>
            </select></td>
            <td><select>
              <option value = {value.topicId}>
              {value.topicName}
              </option>
            </select></td>
            <td>{value.serviceType}</td>
              <td><select>
                <option>Online</option>
                <option>Offline</option>
                <option>Group Discussion</option>
              </select></td>
              <td><input type = "text"/></td>
            <td>
            <button className="btn btn-info">Register</button>
            </td>
            <td></td>
          </tr>
        )})}
        </tbody>
        </table>
        <Datetime />
      </div>
    );
  }

}
